--------------------------------------------------------
--  DDL for Trigger NOTAM_SEQUENCE_TRG
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "NOTAM_SEQUENCE_TRG" BEFORE
  INSERT ON "NOTAM" FOR EACH ROW 
  declare
   updated_sequence_id number;
  BEGIN
    if :new.nature = 'C' or :new.nature = 'R' then
      updated_sequence_id := NULL;
      UPDATE notam SET state = :new.nature 
        where series = :new.replace_series 
          and year = :new.replace_year
          and snumber = :new.replace_snumber
          returning sequence_id into updated_sequence_id;
      if updated_sequence_id is NULL then
          RAISE_APPLICATION_ERROR(-20003, 'ERROR: NOTAM for replacing not exists'); --ERROR: NOTAM for replacing not exists
      end if;
      :new.sequence_id := updated_sequence_id;
      if :new.nature = 'C' then
        :new.state := 'L';
      end if;
    end if;
  END;
/
ALTER TRIGGER "NOTAM_SEQUENCE_TRG" ENABLE;
