--  DDL for Trigger USERS_ADMIN
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "USERS_ADMIN" 
BEFORE DELETE OR INSERT OR UPDATE ON users FOR EACH ROW 
BEGIN
  if DELETING then
    if :old.id = 1 then
      RAISE_APPLICATION_ERROR(-20001, 'ERROR: superuser can not be deleted');
    end if;
    if :old.id = 0 then
      RAISE_APPLICATION_ERROR(-20001, 'ERROR: aftnservice user can not be deleted');
    end if;
  elsif UPDATING then
    if :old.id = 1 and :new.isactive = 0
      then
      RAISE_APPLICATION_ERROR(-20001, 'ERROR: superuser can not be updated');
    end if;
    if :old.id = 0 then
      RAISE_APPLICATION_ERROR(-20001, 'ERROR: aftnservice user can not be deleted');
    end if;
  elsif INSERTING then
    NULL;
  end if;
END;
/
ALTER TRIGGER "USERS_ADMIN" ENABLE;
