--  DDL for View FPL_TABLE
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "FPL_TABLE" ("ID", "TRTIME", "AIRCRAFT_ID", "FRULES", "TFLIGHT", "NUM", "TAIRCRAFT", "WTC", "EQUIPMENT", "ADEP", "TIME", "SPEED", "FLEVEL", "ROUTE", "ADES", "EET", "ALT1", "ALT2", "OTHER") AS 
  SELECT
       TO_CHAR(id) as id,
       TO_CHAR(trtime, 'YYYYMMDDHH24MISS') as trtime,
       aircraft_id as aircraft_id,
       frules as frules,
       tflight as tflight,
       TO_CHAR(num) as num,
       taircraft as taircraft,
       wtc as wtc,
       equipment as equipment,
       adep as adep,
       TO_CHAR(time,'HH24MI') as time,
       speed as speed,
       flevel as flevel,
       route as route,
       ades as ades,
       TO_CHAR(eet, 'HH24MI') as eet,
       alt1 as alt1,
       alt2 as alt2,
       other as other
FROM
       FPL
WHERE
      visibility > 0;
